import numpy as np
import matplotlib.pyplot as plt
import pandas as pd

"""## Importing the dataset"""

dataset = open("RSSI.txt", "r")
dataset_splitted = dataset.read().split('\n')
if (len(dataset_splitted) % 2 != 0) : 
  print("The length of data is wrong")

x = np.array([], np.float64)
y = np.array([], np.float64)
for i in range(int(len(dataset_splitted) / 2)):
  rssi_str = dataset_splitted[i*2 + 0].split(',')
  rssi_array = [eval(rssi) for rssi in rssi_str]
  print(rssi_array)
  distance = eval(dataset_splitted[i*2 + 1])
  distance_array = [distance for i in range(len(rssi_array))]
  print(distance_array)
  # print(x)
  # print(y)
  # data[0].append(rssi_array)
  # data[1].append(distance_array)
  x = np.append(x, rssi_array)
  y = np.append(y, distance_array)

x = np.reshape(x, (len(x), 1))
y = np.reshape(y, (len(y), 1))
print(x, len(x))
print(y, len(y))

