"""## Feature Scaling"""

from sklearn.preprocessing import StandardScaler

ss_rssi = StandardScaler()
ss_distance = StandardScaler()
x_scaled = ss_rssi.fit_transform(x)
y_scaled = ss_distance.fit_transform(y)

"""Alasan mengapa harus menggunakan feature scaling adalah SVR berhubungan dengan persamaan implisit, yang artinya data input dan output berorde yang beda, maka akan ada yang serasa tidak signifikan entah dari independent atau dependent variable, sehingga menyulitkan membangun model"""

print(x_scaled)

print(y_scaled)

"""## Training the SVR model on the whole dataset"""

from sklearn.svm import SVR
reg_svr = SVR(kernel = 'rbf')
reg_svr.fit(x_scaled,y_scaled)

"""Ada berbagai macam kernel, ada kernel linear untuk hubungan independet dan dependent variable yang berhubungan linear. kernel yang paling umum adalah radial basis function (rbf)

## Predicting a new result
"""

pos_pred = np.array([[-60+i for i in np.arange(1,9)]])
pos_pred = pos_pred.reshape(len(pos_pred[0]),1)
x_test = ss_rssi.transform(pos_pred)
print(x_test)
y_test=reg_svr.predict(x_test)
y_test=y_test.reshape(len(y_test),1)
print(ss_distance.inverse_transform(y_test))

"""Dikarenakan pembuatan model sebelumnya harus menggunakan scaling, maka ketika melakukan test/produksi nilai independent variables harus discaling seperti saat training. lalu dengan menggunakan mean dan variance yang didapatkan saat training, nilai independet variable test akan diubah sehingga scalanya sama dengan independet variable ketika training, yaitu standardization scaling. lalu hasil scaling ini akan dimasukkan ke model svr untuk memprediksi output.

DIkarenakan pada saat training dependent variable discaling juga, maka output dari model adalah nilai dengan scaling pula, oleh karena itu perlu di inverse scaling. rumusnya adalah sebagai berikut :
$y=y'.œÉ+Œº$ dengan y adalah output asli dan y' adalah output dengan scaling

## Visualising the SVR results
"""

